    uint256 constant G2y2 = 4082367875863433681332203403145435568316851327593401208105741076214120093531;

    // Verification Key data
    uint32 constant n         = 4096;
    uint16 constant nPublic   = 2;
    uint16 constant nLagrange = 2;

    uint256 constant Qmx  = 19707229271130836924838193168793887279430092581543103250679465723037522355108;
    uint256 constant Qmy  = 4388763195860191863119062466023496630707847630487902248191575496584216926661;
